import React from 'react';
import { Routes, Route, Link } from 'react-router-dom';
import CoursesOld from './CoursesOld';
import CoursesYoung from './CoursesYoung';
import './Courses.css';

const Courses = () => {
    console.log("Courses component rendered"); // Debug message
    return (
        <div className='main__content'>
            <p>Добро пожаловать на страницу о курсах!</p>
            <Routes>
                <Route path="courses_young" element={<CoursesYoung />} />
                <Route path="courses_old" element={<CoursesOld />} />
                <Route path="*" element={<Courses />} />
            </Routes>
        </div>
    );
};

export default Courses;
